import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './components/Login';
import Register from './components/Register';
import Home from './components/Home';
import Search from './components/Search';
import ProdInfo from './components/ProdInfo';
import Profile from './components/Profile';
import BilingView from './components/BilingView';
import GamesUser from './components/GamesUser';
import { AuthProvider } from './components/AuthService';
const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();

const App = () => {
  return (
    <>
      <NavigationContainer>
        <AuthProvider>
          <Drawer.Navigator initialRouteName="Home">
            <Drawer.Screen name="Home" component={Home} />
            <Drawer.Screen name="Profile" component={Profile} />
            <Drawer.Screen name="Login" component={LoginScreen} />
            <Drawer.Screen name="Register" component={Register} />
          </Drawer.Navigator>
        </AuthProvider>
      </NavigationContainer>
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen name="Search" component={Search} />
          <Stack.Screen name="ProdInfo" component={ProdInfo} />
          <Stack.Screen name="Biling" component={BilingView} />
          <Stack.Screen name="Games" component={GamesUser} />
        </Stack.Navigator>
      </NavigationContainer>
    </>
  );
};

export default App;
